import React from 'react';
import './App.css';

function App() {

  const name: string = "Pedro"
  const age: number = 12
  const isTrue: boolean = true

  const getName = (name: string) =>{
    return "Name is " + name
  }

  return (
    <div className="App">
      {name}<br/>
      {age}<br/>
      {isTrue}<br/>
      {getName('ss')}
    </div>
  );
}

export default App;
